  filter_out_expected[3284] <= 2.6170957567076952E-01;
  filter_out_expected[3285] <= 2.3277516952236038E-01;
  filter_out_expected[3286] <= -2.1809401511368140E-01;
  filter_out_expected[3287] <= -3.0008268700369123E-01;
  filter_out_expected[3288] <= 9.3145828683125181E-02;
  filter_out_expected[3289] <= 6.2913215194221217E-01;
  filter_out_expected[3290] <= -4.5717863559554134E-01;
  filter_out_expected[3291] <= -3.5494213577258216E-01;
  filter_out_expected[3292] <= 3.8839943916466801E-01;
  filter_out_expected[3293] <= 2.3721670594212491E-01;
  filter_out_expected[3294] <= -3.3161622524541973E-01;
  filter_out_expected[3295] <= -1.2055493962925891E-01;
  filter_out_expected[3296] <= 2.6215005683548998E-01;
  filter_out_expected[3297] <= 1.1159484506602070E-02;
  filter_out_expected[3298] <= -1.8736855298083005E-01;
  filter_out_expected[3299] <= 1.2131519797294438E-01;
